name = "six"
version = "1.16.0"
requires_python = ">=2.7, !=3.0.*, !=3.1.*, !=3.2.*"
summary = "Python 2 and 3 compatibility utilities"

[[package]]
name = "termcolor"
version = "2.0.1"
requires_python = ">=3.7"
summary = "ANSI color formatting for output in terminal"

